import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import PetList from './pages/PetList';
import NovoPet from './pages/NovoPet';
import PetDetails from './pages/PetDetails';
import NovoEvento from './pages/NovoEvento';
import NovoAdmin from './pages/NovoAdmin';
import AdminList from './pages/AdminList';
import AdminDetails from './pages/AdminDetails';
import DonoDetails from './pages/DonoDetails';
import NovoDono from './pages/NovoDono';
import DonoList from './pages/DonoList';
import TutorList from './pages/TutorList';
import TutorDetails from './pages/TutorDetails';
import NovoTutor from './pages/NovoTutor';

export default function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/pets" element={<PetList />} />
        <Route path="/pets/novo" element={<NovoPet />} />
        <Route path="/pets/:id" element={<PetDetails />} />
        <Route path="/pets/:id/novo-evento" element={<NovoEvento />} />
        <Route path="/admins/novo" element={<NovoAdmin />} />
        <Route path="/admins" element={<AdminList />} />
        <Route path="/admins/:id" element={<AdminDetails />} />
        <Route path="/donos/:id" element={<DonoDetails />} />
        <Route path="/donos/novo" element={<NovoDono />} />
        <Route path="/donos" element={<DonoList />} />
        <Route path="/tutores" element={<TutorList />} />
        <Route path="/tutores/:id" element={<TutorDetails />} />
        <Route path="/tutores/novo" element={<NovoTutor />} />
      </Routes>
    </Router>
  );
}
